import React, { useState, useEffect } from "react";

const Search = () => {
  const [term, setTerm] = useState("");

  return (
    <div>
      <div className="ui form">
        <div className="field">
          <label>Enter Search Term</label>
          <input className="input" onChange={(e) => setTerm()} value={term} />
        </div>
      </div>
    </div>
  );
};

export default Search;
